// src/components/OrdemServicoDetalhe.js
import React, { useEffect, useState } from 'react';

const OrdemServicoDetalhe = ({ match }) => {
  const [ordem, setOrdem] = useState(null);
  const [comentarios, setComentarios] = useState([]);
  const ordemId = match.params.id;

  useEffect(() => {
    // Simula busca da OS e dos comentários no banco de dados
    const dadosOrdem = {
      id: ordemId,
      numero_protocolo: 'PROTO123',
      nome_solicitante: 'João Silva',
      telefone_solicitante: '11987654321',
      data_abertura: '2025-05-01',
      data_agendamento: '2025-05-05',
      nome_empresa: 'Clínica Vida',
      endereco: 'Av. Brasil, 456',
      problema_reportado: 'Monitor sem imagem',
      tipo_visita: 'Técnico',
      modalidade: 'Presencial',
      nome_tecnico: 'Carlos Souza',
      descricao_servico: 'Troca do cabo de vídeo',
      estado_equipamento: 'Ligando normalmente após troca',
      nome_acompanhante: 'Ana Paula',
      assinatura_acompanhante: 'data:image/png;base64,...', // Exemplo base64
      assinatura_tecnico: 'data:image/png;base64,...',
      imagens_servico: [
        'https://via.placeholder.com/150',
        'https://via.placeholder.com/150',
      ],
      data_finalizacao: '2025-05-06',
      status: 'Finalizado',
      pecas_utilizadas: 'Cabo VGA, adaptador de energia',
    };

    const dadosComentarios = [
      {
        autor: 'Carlos Souza',
        mensagem: 'Realizado teste final com o técnico.',
        data: '2025-05-06 14:32',
      },
      {
        autor: 'Admin',
        mensagem: 'Ordem revisada e encerrada.',
        data: '2025-05-06 16:45',
      },
    ];

    setOrdem(dadosOrdem);
    setComentarios(dadosComentarios);
  }, [ordemId]);

  if (!ordem) return <p>Carregando...</p>;

  return (
    <div style={{ padding: '20px' }}>
      <h2>Detalhes da Ordem de Serviço</h2>

      <h4>Informações da Oportunidade (via Órbita App)</h4>
      <p><strong>Protocolo:</strong> {ordem.numero_protocolo}</p>
      <p><strong>Solicitante:</strong> {ordem.nome_solicitante}</p>
      <p><strong>Telefone:</strong> {ordem.telefone_solicitante}</p>
      <p><strong>Data de Abertura:</strong> {ordem.data_abertura}</p>
      <p><strong>Data de Agendamento:</strong> {ordem.data_agendamento}</p>
      <p><strong>Empresa:</strong> {ordem.nome_empresa}</p>
      <p><strong>Endereço:</strong> {ordem.endereco}</p>
      <p><strong>Problema Reportado:</strong> {ordem.problema_reportado}</p>
      <p><strong>Tipo de Visita:</strong> {ordem.tipo_visita}</p>
      <p><strong>Modalidade:</strong> {ordem.modalidade}</p>
      <p><strong>Técnico:</strong> {ordem.nome_tecnico}</p>

      <h4>Dados Técnicos Preenchidos</h4>
      <p><strong>Descrição do Serviço:</strong> {ordem.descricao_servico}</p>
      <p><strong>Estado do Equipamento:</strong> {ordem.estado_equipamento}</p>
      <p><strong>Nome do Acompanhante:</strong> {ordem.nome_acompanhante}</p>
      <p><strong>Data de Finalização:</strong> {ordem.data_finalizacao}</p>
      <p><strong>Status:</strong> {ordem.status}</p>
      <p><strong>Peças Utilizadas:</strong> {ordem.pecas_utilizadas}</p>

      <h4>Assinaturas</h4>
      <div>
        <p><strong>Assinatura do Técnico:</strong></p>
        <img src={ordem.assinatura_tecnico} alt="Assinatura Técnico" height="100" />
      </div>
      <div>
        <p><strong>Assinatura do Acompanhante:</strong></p>
        <img src={ordem.assinatura_acompanhante} alt="Assinatura Acompanhante" height="100" />
      </div>

      <h4>Imagens do Serviço</h4>
      <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
        {ordem.imagens_servico.map((url, index) => (
          <img key={index} src={url} alt={`Imagem ${index + 1}`} width="150" />
        ))}
      </div>

      <h4>Histórico de Comentários</h4>
      {comentarios.length > 0 ? (
        <ul>
          {comentarios.map((c, index) => (
            <li key={index}>
              <strong>{c.autor}</strong> ({c.data}): {c.mensagem}
            </li>
          ))}
        </ul>
      ) : (
        <p>Nenhum comentário registrado.</p>
      )}
    </div>
  );
};

export default OrdemServicoDetalhe;
